CREATE DEFINER=`root`@`localhost` FUNCTION `fn_demanda_ap` (`poblacion` DOUBLE) RETURNS DOUBLE BEGIN
	DECLARE demanda double;
        IF ROUND(poblacion, 0) <= 2500 THEN
                SET demanda = ROUND(poblacion, 0) * 150 * 365 /1000;
        ELSEIF ROUND(poblacion, 0) > 2500 THEN
                SET demanda= ROUND(poblacion, 0) * 250 * 365 /1000;
        END IF;

        RETURN(demanda);

END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fn_tipo` (`poblacion` DOUBLE) RETURNS VARCHAR(50) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci BEGIN
	DECLARE tipo varchar(50);
        IF ROUND(poblacion, 0) <= 2500 THEN
                SET tipo = "RURAL";
        ELSEIF ROUND(poblacion, 0) > 2500 THEN
                SET tipo= "URBANA";
        END IF;

        RETURN(tipo);

END$$

DELIMITER ;

